import React from "react";
import './components/ExpenseItems';
import ExpenseItems from "./components/ExpenseItems";

function App() {
  const expense = [
    { title: 'Bilförsäkring', amount: 269, date: new Date(2022, 2, 28)},
    { title: 'Blöjor', amount: 49, date: new Date(2021, 1, 28)}, 
    { title: 'Biobiljetter', amount: 150, date: new Date(2022, 4, 21)} 
  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItems 
        amount={expense[0].amount} 
        title={expense[0].title} 
        date={expense[0].date}/>
      <ExpenseItems 
        amount={expense[1].amount} 
        title={expense[1].title} 
        date={expense[1].date}/>
      <ExpenseItems 
        amount={expense[2].amount} 
        title={expense[2].title} 
        date={expense[2].date}/>
    </div>
  );
}

export default App;
